import time
import sys

def lcs_length(x, y): #Dynamic programming implementation
    m = len(x)
    n = len(y)
    b = [[i for i in range(1,n)] for j in range(1,m)]
    c = [[i for i in range(n)] for j in range(m)]
    for i in range(1,m):
        c[i][0] = 0
    for j in range(n):
        c[0][j] = 0
    for i in range(1,m):
        for j in range(1,n):
            if x[i] == y[j]:
                c[i][j] = c[i-1][j-1] + 1
                b[i-1][j-1] = "up-left"
            elif c[i-1][j] >= c[i][j-1]:
                c[i][j] = c[i-1][j]
                b[i-1][j-1] = "up"
            else:
                c[i][j] = c[i][j-1]
                b[i-1][j-1] = "left"

    return c, b

def print_lcs(b, X, i, j, k=0): #Print dynamically generated lcs
    if i == 0 or j == 0:
        print(k)
        return
    if b[i-1][j-1] == 'up-left':
        print_lcs(b, X, i-1, j-1, k+1)
        #print(X[i])
    elif b[i-1][j-1] == 'up':
        print_lcs(b, X, i-1, j, k)
    else:
        print_lcs(b,X,i,j-1, k)

def test_lcs_length(x,y): #Tests the dynamic implementation
    c,b = lcs_length(x,y)
    #print(c)
    #print(b)
    print_lcs(b, x, len(x)-1, len(y)-1)


def recursive_lcs(x, y, i, j): #Recursive implementation
    c = [[i for i in range(len(y))] for j in range(len(x))]
    if i == 0 or j == 0:
        c[i][j] = 0
    elif x[i] == y[j]:
        c[i][j] = recursive_lcs(x, y, i-1, j-1) +1
    else:
        c[i][j] = max(recursive_lcs(x, y, i-1, j), recursive_lcs(x, y, i, j-1))
    return c[i][j]

def test_recursive(x,y): #Tests the recursive implementation
    print(recursive_lcs(x, y, len(x)-1, len(y)-1))


